import "./styles/App.css";
import Header from "./components/Header";
import Maps from "./components/Maps";
import Map from "./components/GamePage";
import { Route } from "react-router-dom";

function App() {
  return (
    <>
      <Header />
      <Maps />
      <Route path="/gamePage">
        <Map />
      </Route>
    </>
  );
}
export default App;
